import { useEffect, useState } from 'react';
import gql from "graphql-tag";
import Head from 'next/head';

import Layout, { client } from '../../components/Layout';
import Loader from '../../components/Loader';


const launches = () => {

    useEffect(() => {
        setId(query.id)

        client
            .query({
                query: gql`
                        query GET_Luanches {
                            launches {
                              mission_name
                              launch_date_local
                              launch_site {
                                site_name
                              }
                              launch_success
                              rocket {
                                rocket_name
                                rocket {
                                  id
                                }
                              }
                            }
                          }
                    `
            })
            .then(result => {
                console.log(result)
                // setRocket(result.data.rocket)
                setIsLoading(false)
            });
    }, [])

    return (
        < Layout >
            <section class="section">
                <div class="container" style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
                    <table class="table table is-striped is-fullwidth">
                        <thead>
                            <tr>
                                <th>Mission</th>
                                <th>Launch Date</th>
                                <th>Mission Name</th>
                                <th>Launch Site</th>
                                <th>Rocket</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <th>True</th>
                                <td>20 - 10 -2019</td>
                                <td>Thaicom 6</td>
                                <td>CCAFS SLC 40</td>
                                <td>Falcon 9</td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </section>
        </Layout >
    );
}

export default launches;
